import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Main from '../src/';
import Home from './Component/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route element={<Main />}>
          <Route path="/" element={<Home />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
